import React from "react";

const Services = () => {
  return (
    <section className="services">
      <div className="container">
        <h2 className="heading-secondary u-margin-bottom ">خدمات سوشلها</h2>
        <div className="row services__text-box">
          <h3 className='third-'>التسويق الرقمي</h3>
          <div className="col-4-lg col-3-md col-12-sm">
            <div>
              <i></i>
              <p>إدارة الحملات الإعلانية</p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};
export default Services;
